import React from "react";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { logoutSucces } from "../redux/authActions";
import ProfileImageWithDefault from "../components/ProfileImageWithDefault";
import { useTranslation } from "react-i18next";
import logo from "../assets/logo.png";

const Sidebar = () => {
  const { displayName, isLoggedIn, image, username } = useSelector((store) => ({
    isLoggedIn: store.isLoggedIn,
    displayName: store.displayName,
    image: store.image,
    username: store.username,
  }));
  const { t } = useTranslation();
  const dispatch = useDispatch();

  const onLogoutSuccess = () => {
    dispatch(logoutSucces());
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark d-lg-block">
      {isLoggedIn && (
        <div className="container">
          <Link className="navbar-brand" to="/">
            <img src={logo} width="48" alt="Hoaxify logo" />
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#sidebarNavbar"
            aria-controls="sidebarNavbar"
            aria-expanded="false"
            aria-label="Toggle sidebar"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="sidebarNavbar">
            <ul className="navbar-nav flex-column mt-4 mt-lg-0">
              <li className="nav-item">
                <Link
                  to="/"
                  className="nav-link d-flex align-items-center text-secondary"
                >
                  <i className="fas fa-home me-2"></i>
                  {t("Home")}
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  to={"/users/" + username}
                  className="nav-link d-flex align-items-center text-dark"
                >
                  <ProfileImageWithDefault
                    image={image}
                    width="24"
                    height="24"
                    className="rounded-circle me-2"
                  />
                  <span>{displayName}</span>
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  to={"/users/" + username}
                  className="nav-link d-flex align-items-center text-primary"
                >
                  <i className="fas fa-user me-2"></i>
                  {t("My Profile")}
                </Link>
              </li>
              <li className="nav-item" style={{ cursor: "pointer" }}>
                <i className="fas fa-magnifying-glass me-2"></i> {t("Explore")}
              </li>
              <li className="nav-item" style={{ cursor: "pointer" }}>
                <i className="fas fa-bell me-2 text-warning"></i>{" "}
                {t("Notifications")}
              </li>
              <li className="nav-item" style={{ cursor: "pointer" }}>
                <i className="fas fa-envelope me-2 text-secondary"></i>{" "}
                {t("Messages")}
              </li>
              <li className="nav-item" style={{ cursor: "pointer" }}>
                <i className="fas fa-user-group me-2"></i> {t("Friends")}
              </li>
              <li className="nav-item" style={{ cursor: "pointer" }}>
                <i className="fas fa-circle-check me-2 text-info"></i>{" "}
                {t("Verified User")}
              </li>
              <li className="nav-item" style={{ cursor: "pointer" }}>
                <i className="fas fa-circle-info me-2 text-success"></i>{" "}
                {t("Help")}
              </li>
              <li className="nav-item" style={{ cursor: "pointer" }}>
                <i className="fas fa-cog me-2"></i> {t("Settings")}
              </li>
              <li className="nav-item" onClick={onLogoutSuccess}>
                <Link
                  to="/login"
                  className="nav-link d-flex align-items-center"
                >
                  <i className="fa-solid fa-right-from-bracket me-2"></i>
                  {t("Logout")}
                </Link>
              </li>
              {/* Add more buttons for other functionalities */}
            </ul>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Sidebar;
